import { Component, OnInit } from '@angular/core';
import { Form, FormBuilder, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-registro',
  templateUrl: './registro.component.html',
  styleUrls: ['./registro.component.css']
})
export class RegistroComponent implements OnInit {
  register!:FormGroup;
  constructor(private fb:FormBuilder) { }

  ngOnInit(): void {
  }
  initForm(){

  return this.fb.group({
  name:['',Validators.required],
  documen:['',Validators.required],
  date:['',Validators.required],
  email:['',Validators.required],
  password:['',Validators.required]
  comfi
  });
  }

}
<div class="register-photo">
    <div class="form-container">
        <div class="image-holder"></div>
        <form >
            <h2 class="text-center"><strong>Crea</strong> una cuenta</h2>
            <div class="form-group"><input class="form-control" type="text" name="text" placeholder="Documento de identidad"></div>
            <div class="form-group"><input class="form-control" type="text" name="text" placeholder="Nombre completo"></div>
            <div class="form-group"><input class="form-control" type="date" name="date" placeholder="Fecha de nacimiento"></div>
            <div class="form-group"><input class="form-control" type="email" name="email" placeholder="Email"></div>
            <div class="form-group"><input class="form-control" type="password" name="password" placeholder="Contraseña"></div>
            <div class="form-group"><input class="form-control" type="password" name="password-repeat" placeholder="Confirmar contraseña"></div>
            <div class="form-group">
                <div class="form-check"><label class="form-check-label"><input class="form-check-input" type="checkbox">Acepto los términos y condiciones.</label></div>
            </div>
            <div class="form-group"><button class="btn btn-primary btn-block" type="submit">Registrate</button></div><a routerLink="/auth/login" class="already">Ya tienes una cuenta? Inicie sesion.</a></form>
    </div>
</div>
